  true,\n\t\"url\": null,\n\t\"notes\": \"Phoenix is a commercial off-the-shelf, web-based
  financial management system configured for USAID. Phoenix provides information about
  commitments, obligations, and expenditures. It is based on Momentum, CGI Federal's
  financial software. Phoenix is the Agency's integrated core financial system used
  by USAID/Washington and 51 Missions. Phoenix is USAID's core financial management
  system, which manages and tracks more than $15 billion each year in funding. It
  provides critical business functions such as general ledger, accounts payable, accounts
  receivable, cost accounting, budgeting, program operations and reporting. Phoenix
  is used to record accounting transactions and make payments for goods or services
  to small businesses, educational or non-profit institutions, and USAID contractors.\",\n\t\"license_title\":
